ProductGalleryQuery:
query ProductGalleryQuery($first: Int!, $after: String!, $sort: StoreSort!, $term: String!, $selectedFacets: [IStoreSelectedFacet!]!) {
  search(
    first: $first
    after: $after
    sort: $sort
    term: $term
    selectedFacets: $selectedFacets
  ) {
    products {
      pageInfo {
        totalCount
      }
      edges {
        node {
          id: productID
          sku
          name
          gtin
          description
          isVariantOf {
            productGroupID
            name
          }
          image {
            url
            alternateName
          }
          brand {
            name
          }
          offers {
            lowPrice
            offers {
              availability
              price
              listPrice
              seller {
                identifier
              }
            }
          }
          breadcrumbList {
            itemListElement {
              item
              name
              position
            }
          }
        }
      }
    }
    facets {
      key
      label
      type
      values {
        label
        value
        selected
        quantity
      }
    }
  }
}

